(1, 1, 'Hello World', '', 'Write a C program that will print “Hello World!”\r\n\r\n', 'Easy', 10, '', 'Hello World!', NULL, '2026-01-24 14:03:08'),
(2, 1, 'Print Multiple Lines', NULL, 'Write a C program that will print the lines given in the sample output.', 'Easy', 10, '', 'Hello World!\r\nWelcome to C programming.\r\nThis is going to be fun!', NULL, '2026-01-24 22:12:40'),
(3, 1, 'Basic Variables', NULL, 'Write a C program where you will declare an integer, a floating point and a character variable, initialize them by values of your choice, and print these values.', 'Easy', 10, '', 'Integer value = 17\nFloating point value = 3.508\nCharacter value = W', NULL, '2026-01-25 02:50:35'),
(4, 1, 'Basic Arithmetic Operations', NULL, 'Write a C program where you will declare two integer variables, initialize them by values of your choice, and perform the basic arithmetic operations on them. The basic arithmetic operations are addition (+), subtraction (-), multiplication (*), division (/) and remainder (%).', 'Easy', 10, '', '18 + 7 = 25\r\n18 - 7 = 11\r\n18 * 7 = 126\r\n18 / 7 = 2\r\n18 % 7 = 4', NULL, '2026-01-25 02:52:42'),
(5, 1, 'Floating Point Arithmetic Operations', NULL, 'Write a C program where you will declare two floating point variables, initialize them by values of your choice, and perform the basic arithmetic operations on them. Note that the remainder operation is invalid for floating point numbers.', 'Easy', 10, '', '95.401 + 22.622 = 118.023\r\n95.401 - 22.622 = 72.779\r\n95.401 * 22.622 = 2158.161422\r\n95.401 / 22.622 = 4.217178', NULL, '2026-01-25 02:54:09'),
(6, 1, 'Evaluate Arithmetic Expression', NULL, 'Write a C program where you will declare four integer variables (say a, b, c and d), initialize them by values of your choice, and calculate a * b + (a – c) / d + b.', 'Easy', 10, '', '21 * 15 + (21 - 34) / 6 + 15 = 327', NULL, '2026-01-25 02:55:41'),
(7, 1, 'rfhydgydvhyvd', 'rfhydgydvhyvd', 'CFHC CFGCXG XFGXFHDFHXFHFX', 'Easy', 10, 'hxddgxd', 'xgdx', 4, '2026-01-25 06:29:23');
